import React from 'react';
import SocialMedia from '../socialmedia';
import './styles.css'

function contacts() {
  return (
    <div className='contacts-container'>
        <div className="header">
            <div className="cardzin">
                <h1 className='project-title'>Contatos</h1>
            </div>
        </div>
        <div className="contacts-content">
            <div className="social-medias">
                <SocialMedia href="" src="https://cdn-icons-png.flaticon.com/512/733/733585.png" content="Whatsapp"/>
                <SocialMedia href="" src="https://cdn-icons-png.flaticon.com/512/4138/4138124.png" content="Instagram"/>
                <SocialMedia href="" src="https://cdn-icons-png.flaticon.com/512/3536/3536505.png" content="Instagram"/>
                <SocialMedia href="https://github.com/0thigs" src="https://cdn-icons-png.flaticon.com/512/733/733553.png" content="Github"/>
            </div>
        </div>
    </div>    
);
}

export default contacts;
